INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("青空の下で謁見", 7, 0, 5118061, "ペコリーヌとの出会い", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 10118, "フリーマーケット会場", 2, 2834, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("未来の騎空団\nマスコット？", 7, 0, 5118062, "マホとの出会い", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 10118, "フリーマーケット会場", 2, 2835, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("お嬢さまからの\n緊急依頼", 7, 0, 5118063, "アキノとの出会い", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 10118, "ランドソル市街地", 2, 2837, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("黄金色の悩みごと", 18, 0, 5118064, "ジュンとの出会い", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 10118, "フリーマーケット会場", 2, 4108402, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("白熱！　格闘大会！", 18, 0, 5118065, "カオリとの出会い", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 10118, "フリーマーケット会場", 2, 4107402, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("祭り太鼓はオーエドの華", 16, 1, 5118066, "ニノンとの出会い", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 10118, "オーエド町", 2, 9000227, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("人気者は遅れて\nやってくる", 19, 0, 5118067, "スズナとの出会い", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 10118, "フリーマーケット会場", 3, 2101181, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("巫女・ミーツ・魔法少女", 18, 0, 5118068, "ナナカとの出会い", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 10118, "ランドソル市街地", 3, 4109402, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("ネズ耳は二度なくなる", 18, 0, 5118069, "キャル＆コッコロとの出会い", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 10118, "フリーマーケット会場", 3, 4305402, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("この出会いにカンパイ！", 18, 0, 5118070, "ユカリとの出会い", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 10118, "ランドソル市街地", 3, 4101402, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("陰陽アンサンブル", 18, 0, 5118071, "アオイとの出会い", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 10118, "ランドソル市街地", 3, 4106402, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("運試し十番勝負！", 7, 1, 5118072, "シノブとの出会い", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 10118, "フリーマーケット会場", 3, 2836, 0, 1, 91002, 40, 8);
INSERT INTO `v1_fe71908bcb5a8b0c1c0d9095e57dfab6eb23d202e3f671e18d0ac21685b962a2` VALUES ("彼女たちの新たな日常", 0, 0, 5118600, "オープニング", 0, 10118, 0, 1, 0, 10145115, 0, 0, 0, 0);
